  // Optional: Search function included for convenience (searches by name)
  export function searchPlayers(searchTerm, availablePlayers) {
      if (!searchTerm || !Array.isArray(availablePlayers)) return [];
      searchTerm = searchTerm.toLowerCase().trim();
      return availablePlayers.filter(player =>
          player?.name?.toLowerCase().includes(searchTerm)
      );
  }
  